import { ReactComponent as CheckSVG } from '../img/img_done.svg'
import { ReactComponent as DeleteSVG} from '../img/img_delete.svg'

const iconTypes = {
    'check': <CheckSVG />,
    'delete': <DeleteSVG />
}

function TodoIcon({ type }) {
    return (
        <span className={`Icon Icon-svg Icon-${type}`}>
            {iconTypes[type]}            
        </span>
    )

}

export {TodoIcon}
